ネズミのみはり番<br>ブランド：ネズミのみはり番<br>販売・製造元：アース製薬<br><br>ハッカ、琉球ハーブ、ワサビなどの天然ハーブやネコの匂いなど、ネズミが嫌がる成分と匂いを配合した、ゲルタイプのねずみ忌避剤です。<br>台所の隅、倉庫、物置、屋根裏などに置くだけで、簡単にネズミを追い出し寄せつけません。<br> <br><br><br>使用方法<br>1.開封口よりミシン目にそってフィルムをはがして、メンコを取り出してください。<br>2.容器のフタをはずし、アルミシールをはがした後、再度フタを閉めて、天上裏や床下、台所の隅などネズミの通路や侵入口に設置してください。<br> 有効期間・使用の目安約二ヶ月(使用条件により異なります)。<br>6-8畳に1個の割合で使用する。<br> <br><br>使用上の注意<br>・用途以外に使用しないでください。<br>・本品は食べられません。<br>誤って口に入れた時は、水でよくすすいでください。<br>皮膚についた場合は、石けんを用いてよく洗ってください。<br>万一、異常がある場合は医師に相談してください。<br>・本品はネズミが嫌う臭いを主成分としていますが、臭いに慣れたネズミや感受性の乏しいネズミには効果が出にくい場合があります。<br>・薬剤によってアレルギー症状やかぶれ等を起こしやすい体質の人は使用しないでください。<br>・子どもの手の届くところに置かないでください。<br>・中身をとりだしたりしないでください。<br>・ペットや家畜のいる場所では使用しないでください。<br>・有機溶剤に弱いプラスチック類の近くでは使用しないでください。<br>・直射日光を避け、なるべく冷所で子どもの手の届かない所に保管してください。<br>・捨てるときは、そのまま不燃ゴミとして捨ててください。<br> <br>成分<br>天然ハッカ油、天然ワサビオイル、天然琉球ハーブ(月桃)エキス、香料 <br>日用品／虫よけ・殺虫剤・忌避／忌避用品／ねずみ忌避剤<br>JANコード： 4901080253910<br><br>CS：20<br>広告文責：アットライフ株式会社<br>TEL 079-280-2113<br>※商品パッケージは変更の場合あり。<br>メーカー欠品または完売の際、キャンセルをお願いすることがあります。ご了承ください。<br><style type="text/css">
