デスモアプロ トレータイプ 4セット入<br>ブランド：デスモアプロ<br>販売・製造元：アース製薬<br><br>ジフェチアロールを配合したトレータイプの殺鼠剤です。<br>ワルファリン等は、3-5日連続して食べさせることが必要ですが、ジフェチアロールは、一度食べれば効くので、警戒心の強いネズミでもしっかり駆除できます。<br>シールをはがしてそのまま置ける防水トレー入りなので、濡れたところや汚れたところにも置けます。<br>クマネズミ、ドブネズミ等の大型ネズミだけでなく、スーパーラット(ワルファリン抵抗性ネズミ)にも。<br> <br>効能・効果ネズミの駆除 <br><br>使用方法<br>●台所、流し台の下、物置、押入れ、壁際、天井裏などのネズミが出没する場所の数か所に、シールをはがして、容器ごと適量(約10-30g)を設置して下さい。<br>容器には15gの薬剤が入っています。<br>ネズミがたくさんいる場合は、多くの場所に設置するとより効果的です。<br>●薬剤のなくなったところは補充し、食べなくなるまで続けてください。<br>●屋外に配置する際は、薬剤が雨で濡れないようにしてください。<br>●食いつきの悪いときは、コーン油、ソースなどを分包に数滴ふりかけると食いつきが良くなります。<br> 保管および<br><br>使用上の注意<br>●人や家畜、ペットにも有害ですので、乳幼児・小児やペットなどが容易に近づける場所で使用しないでください。<br>●食品、食器、飼料などに本品の薬剤が付着しないように注意してください。<br>●皮膚や衣類などに本品の薬剤が付着しないように注意してください。<br>●魚に対する毒性もありますので、本品の薬剤を湖沼、河川及び池などに流さないでください。<br>●万一過って食べた場合は直ちに吐き出させ、医師の診察を受けてください。<br>●ペットなどが誤食した場合にも、直ちに獣医師の診察を受けてください。<br>●医師、獣医師の診察を受ける際には、本品が抗血液凝固作用のあるクマリン系のジフェチアロールを含有することを告げてください。<br>治療剤としては、ビタミンK1が有効です。<br> その他の注意●定められた用法用量を守ってください。<br>●本品の薬剤に直接触れないでください。<br>万一、皮膚に薬剤がついた場合は、石けんを用いて水でよく洗ってください。<br>●土間や台所等の室内は就寝前に配置し、翌朝残った薬餌は回収してください。<br>●本品設置後は、何日も放置せず、数日経過後も食べない場合は、回収または場所を移動してください。<br> 保管及び取扱い上の注意●食品、食器、飼料などと区別して保管してください。<br>●湿気を避け、乳幼児、小児の手の届かない所に保管してください。<br>●使用後残った本品についても、乳幼児、小児、ペットなどが触れないように注意して廃棄してください。<br>●使用後残った本品(薬剤部分)は可燃物として、容器部分は自治体の指示に従って廃棄してください。<br> 有効成分ジフェチアロール <br>日用品／虫よけ・殺虫剤・忌避／殺虫剤／殺鼠剤<br>JANコード： 4901080053411<br><br>CS：20<br>広告文責：アットライフ株式会社<br>TEL 079-280-2113<br>※商品パッケージは変更の場合あり。<br>メーカー欠品または完売の際、キャンセルをお願いすることがあります。ご了承ください。<br><style type="text/css">
