デスモアプロ 投げ込みタイプ 6包入り<br>ブランド：デスモアプロ<br>販売・製造元：アース製薬<br><br>1度食べるだけで効く強力な殺虫剤ねずみ用です。ジフェチアロール配合、ワルファリンの300倍効く殺鼠成分です。クマネズミ、ドブネズミ等の大型ネズミはもちろん、これまでに効きにくかったスーパーラット(ワルファリン抵抗性ネズミ)など、どんなネズミにもしっかり効きます。分包タイプなので屋根裏や倉庫の奥にも簡単に投げ込むことができ、ネズミがそのまま巣に持ち帰って食べる習性にも適しています。医薬部外品。 <br><br><br>使用方法<br>●ネズミのよく出る場所(台所、流し台の下、物置、押し入れ、壁際、天井裏など)数カ所に、袋をやぶらずにそのまま適量(約10g-30g、2-6包)を配置して下さい。1包には5gの薬剤が入っています。ネズミがたくさんいる場合は、多くの場所に設置するとより効果的です。●薬剤のなくなったところは補充し、食べなくなるまで続けてください。●屋外に配置する際は薬剤が雨で濡れないようにしてください。●食いつきの悪いときは、コーン油、ソースなどを分包に数滴ふりかけると食いつきが良くなります。 <br><br>使用上の注意<br>1.してはいけないこと●人や動物にも有害ですので、乳幼児・小児やペットなどが容易に近づける場所で使用しないでください。●食品、食器、飼料などに本品の薬剤が付着しないように注意してください。●皮膚や衣類などに本品の薬剤が付着しないよう注意してください。●魚に対する毒性もありますので、本品の薬剤を湖沼、河川及び池などに流さないでください。2.相談すること●万一誤って食べた場合は、なるべく吐き出させ、医師の診療を受けてください。●ペットなどが誤食した場合にも、直ちに獣医師の診療を受けてください。●医師、獣医師の診療を受ける際には、本品が抗血液凝固作用のあるクマリン系のジフェチアロールを含有することを告げてください。治療剤としては、ビタミンK1が有効です。3.その他の注意●定められた用法用量を守ってください。●本品の薬剤に直接触れないでください。万一、皮膚に薬剤がついた場合は、石鹸を用いて水でよく洗ってください。●土間、台所などの人が往来する場所に設置する場合は、就寝前に設置し、翌朝回収してください。●本品設置後は、何日も放置せず、数日経過後も食べない場合は、回収又は場所を移動してください。 ご注意<br>人体に使用しないこと 成分有効成分：ジフェチアロール0.0025%(w/w)その他の成分：小麦粉、トウモロコシデンプン、安息香酸Naデナトニウム、赤色102号、青色1号、赤色227号、他5成分 保管および取扱い上の注意●食品、食器、飼料などと区別して保管してください。●湿気を避け、乳幼児、小児の手の届かないところに保管してください。●使用後残った本品についても、乳幼児、小児、動物(ペットなど)が触れないように注意して廃棄してください。●使用後残った本品(薬剤部分)は可燃物として、容器部分は自治体の指示に従って廃棄してください。 <br>日用品／虫よけ・殺虫剤・忌避／殺虫剤／殺虫剤ねずみ用<br>JANコード： 4901080053916<br><br>CS：20<br>広告文責：アットライフ株式会社<br>TEL 079-280-2113<br>※商品パッケージは変更の場合あり。<br>メーカー欠品または完売の際、キャンセルをお願いすることがあります。ご了承ください。<br><style type="text/css">
